import React from "react";

import "./App.css";
import Home from "./Component/Home";
import Header from "./Component/Header";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
im

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
